    false,nt"url": null,nt"notes": "This map is a compilation of previously
    unpublished and published data, as well as from updated field mapping. This publication
    offers a 1:125,000-scale map sheet accompanied by a booklet containing a summary
    of the geology, a colored terrane map, map unit descriptions, a summary table listing
    selected mineral deposits and energy resources, references, and a correlation of
    map units. The text (in the report) describes the geology and resource potential
    of a highly mineralized region centered in the Farewell silver-lead-zinc district
    southeast of McGrath. Potentially important coal resources flanking the Alaska Range
    are also described in the map area.",nt"license_title": null,nt"extras":
